import { View, Text, StyleSheet, Button } from 'react-native'
import React from 'react'
import { config } from '@gluestack-ui/config'
import { GluestackUIProvider, Box, Heading, HStack, ScrollView, Center, VStack } from '@gluestack-ui/themed'
import MusicCard from '../components/MusicCard'
import MusicList from '../components/MusicList'

export default function Home({ navigation }) {
    return (
        <GluestackUIProvider config={config}>

            <View style={{ flex: 1, backgroundColor: '#1f1f1f', paddingLeft: 5, paddingRight: 5, }}>
                <Heading style={styles.light} size='2xl'>Music</Heading>
                {/* Scroll playlist */}
                <ScrollView horizontal={true} marginLeft={5} marginRight={-5} marginTop={20}>
                    <HStack space="sm">
                        <MusicCard txt="Aaaa" style={styles.light} />
                        <MusicCard txt="Aaaa" style={styles.light} />
                        <MusicCard txt="Aaaa" style={styles.light} />
                        <MusicCard txt="Aaaa" style={styles.light} />
                        <MusicCard txt="Aaaa" style={styles.light} />
                    </HStack>
                </ScrollView>
                <Heading style={styles.light} size='2xl'>List</Heading>
                <ScrollView h="$80" w="$100">
                    <VStack space="sm">
                        <MusicList bg/>
                    </VStack>
                </ScrollView>
            </View>

        </GluestackUIProvider>
    )
}

const styles = StyleSheet.create({
    light: {
        // backgroundColor: myColors.light,
        color: '#eaf8ff',
    },
    dark: {
        color: '#1f1f1f',
    },

});
